
import heap_updated


def di_heap(graph,start_node):
    
    #Initialisation starting node as 0    
    shortest_distances = {str(start_node) : 0}  #Starting node value is assigned to zero
        
    #creatung empty dictionary for parent node
    parent_node = {}
    
    #rest of the node value is defined as infinity 
    for i in graph:        
        if i != str(start_node):
            shortest_distances[i] = 'inf' 
            parent_node[i] = start_node  
        else:
            parent_node[start_node] = 'null'              
    
        
    #initialize heap
    h=heap_updated.heap()
    # added starting/root node to heap
    h.items.append([start_node,0])
    
    while len(h.items) > 0:
         
        #print(*h.items)
        curr_node, curr_dist = h.delmin()        
        for neighbour, neighbour_dist in graph[str(curr_node)].items():            
               
            if shortest_distances[neighbour] == 'inf' or int(shortest_distances[neighbour]) > curr_dist + neighbour_dist:
                shortest_distances[str(neighbour)] = curr_dist + neighbour_dist
                parent_node[neighbour] = str(curr_node)                      
                
                
                if neighbour in [i[0] for i in h.items]:
                    #print(neighbour,curr_dist + neighbour_dist)
                    ind=-1
                    for i in h.items:
                        ind += 1
                        if i[0] == neighbour:
                            h.items[ind][1] = curr_dist + neighbour_dist
                            #print(h.items)
                            h.shiftup(ind)
                            
                else:
                    h.insert([neighbour,curr_dist + neighbour_dist])           
            
    #return shortest_distances,parent_node
    print('shortest distances ',shortest_distances)    
    print('parent node',parent_node)
    

    
    
